import React from 'react'
import styles from './UserCard.module.css'
import { useRef } from 'react'

const UserCard = (props) => {
    const ref = useRef(props.ref);
    return (
        <div ref={ref} className={styles.card}>
            {props.username}
        </div>
    )
}

export default UserCard
